import { Component, AfterContentInit, ElementRef, ViewChild } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { ajax, AjaxResponse } from 'rxjs/ajax';

const imagePath = 'data:image/jpeg;base64,';

const shareData = {
  title: 'Certificado - clickCompliance',
  url: 'http://e9614470.ngrok.io/training-certificate/D550A6FF-4BAC-47BE-AAF6-9E145D6C5355?locale=en-us'
};

@Component({
  selector: 'my-app',
  templateUrl: './app.component.html',
  styleUrls: [ './app.component.css' ]
})
export class AppComponent {

  @ViewChild('canvas', {static: true}) canvas: ElementRef<any>;
  @ViewChild('fileInput', {static: true}) fileInputRef: ElementRef<any>;

  name = 'Angular';
  canShare = navigator.canShare && navigator.canShare(shareData);

  download(file: File) {
    const blob = new Blob([file]);
    var element = document.createElement('a');
    element.setAttribute('href', URL.createObjectURL(blob));
    element.setAttribute('download', 'test.png');

    element.style.display = 'none';
    document.body.appendChild(element);

    element.click();

    document.body.removeChild(element);
}

  dataURLtoBlob(dataurl) {
    console.log(dataurl);
      var arr = dataurl.split(','), mime = arr[0].match(/:(.*?);/)[1],
          bstr = atob(arr[1]), n = bstr.length, u8arr = new Uint8Array(n);
      while(n--){
          u8arr[n] = bstr.charCodeAt(n);
      }
      return new Blob([u8arr], {type:mime});
  }

  constructor(http: HttpClient) {

  }

  share() {

    var img = new Image();
    img.crossOrigin = "Anonymous"
    img.onload = () => {
      const canvas = document.createElement('canvas');
      const ctx = canvas.getContext('2d');
      canvas.width = img.width;
      canvas.height = img.height;
      ctx.drawImage(img, 0, 0);
      const canvasData = canvas.toDataURL("image/png");
      const blob = this.dataURLtoBlob(canvasData);
      var file = new File([blob], 'test.png', { type: 'image/png' });
      //this.download(file);
      
      this.shareFiles([file]);
    };
    img.src = imagePath;

    
  }

  share2() {
    console.log(this.fileInputRef.nativeElement.files);
    this.shareFiles(this.fileInputRef.nativeElement.files);
  }

  

  share3() {
    const blob = this.dataURLtoBlob(imagePath);
      var file = new File([blob], 'test.png', { type: 'image/png' });
      //this.download(file);
      
      this.shareFiles([file]);

    
  }

  private shareFiles(files: File[]) {
    try {
      if (navigator.canShare && navigator.canShare({files: files})) {
        alert('can share');
      } else {
        alert('cannot share');
        return;
      }
    } catch {
      alert('exception');
    }

    navigator.share({
        title: 'POrsche',
        files: files
      })
  }
}
